import { Component } from '@angular/core';
import { jsPDF } from 'jspdf';
import autoTable from 'jspdf-autotable'

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'cartas';

  constructor() {}

  DataFromEventEmitter(data: any) {
    console.log(typeof(data));
    console.log(data);

    const doc = new jsPDF();
    var data2 = "data:image/jpeg;base64,";
  

    for (const dato of data) {
      
      console.log(dato.PEDIDO);
      doc.addImage(data2, 'JPEG', 9, 5, 90, 35);
      doc.setFont("arial");
      doc.setFontSize(16)
      doc.text(`${dato.No}`, 170, 40);
      doc.setFontSize(11)
      doc.text('Yumbo, '+`${dato.FECHA}`, 12, 50);
      doc.text('Seores', 12, 70);
      doc.text(`${dato.PROVEEDOR}`, 12, 75);
      doc.text('Referencia: '+`${dato.OBSERVACION}`, 12, 90);
      doc.text('Se confirma la bonificacin por cumplimiento a la meta volumen establecido para el mes de ' +`${dato.MES}` +', se detalla', 12, 105);
      doc.text('a continuacin volmenes y precios liquidados, y ajuste correspondiente:', 12, 115);
      const head = [['ZONA', 'PROVEEDOR', 'TON Real', 'AJUSTE', 'TOTAL', 'PEDIDO']]
      const data4 = [
        [`${dato.ZONA}`, `${dato.PROVEEDOR}`, `${parseFloat(dato.TONREAL).toFixed(2)}`, '$'+`${dato.AJUSTE}`, '$'+`${parseFloat(dato.TOTAL).toFixed(2).replace(/\d(?=(\d{3})+\.)/g, '$&,')}`, `${dato.PEDIDO}`],
      ]
      autoTable(doc, {
        head: head,
        body: data4,
        margin: { top: 130 },
        didDrawCell: (data4) => { },
      });
      doc.text('Por favor emitir factura por concepto de ajuste de Precio Liquidacin por valor de $'+`${dato.TOTAL.toFixed(2).replace(/\d(?=(\d{3})+\.)/g, '$&,')}     `, 12, 170);
      doc.text('Se cruzara como incentivo de transporte al pedido No. '+`${dato.PEDIDO}`, 12, 180);
      doc.text('Atentamente,', 12, 215);
      doc.text('Hector Fabio Esquivel', 12, 235);
      doc.text('Gerente Abastecimiento Materias Primas', 12, 240);
      doc.setFontSize(10)
      doc.text('Propal S.A.', 180, 260);
      doc.text('Kilmetro 6 Carretera Antigua Cali Yumbo', 135, 265);
      doc.text('Valle del Cauca, Colombia', 159, 270);
      doc.setTextColor(0, 0, 255);
      doc.text('www.propal.com.co', 168, 275);
      doc.setTextColor(0, 0, 0);
      doc.text('Tel: (572) 651 2000', 168, 280);
      var data3 = "data:image/png;base64,";
      doc.addImage(data3, 'PNG', 182,280, 18, 10);
      doc.addPage();
    }

    doc.save('cartas.pdf');

  }

}
